package com.webauthn4j.util.jws;

import com.fasterxml.jackson.databind.ObjectMapper;
import org.junit.Test;

import java.util.HashMap;

import static org.assertj.core.api.Assertions.assertThat;

public class JWSTest {

    @Test
    public void isValidSignature_with_invalid_data_test() {
        String input = "..iS1Oh6KXyU87QReMiWRilVlYzxv9Tfk0DgyNM2l2WWa1wzNiVJk9q2bxFP6EKxLA71FvCgfurAZx1Lelp3vmJw";
        JWS jws = JWS.parse(input, new ObjectMapper(), HashMap.class);
        assertThat(jws.isValidSignature()).isFalse();
    }

}